    <div class=\"title\">
        <h1 class=\"h1 mb-3 font-weight-normal text-center\">Authentification</h1>
    </div>

    <hr style=\"background-color: white\">

    <form method=\"post\">
        <div class=\"form-group\">
            <label for=\"inputLogin\" class=\"sr-only\">Identifiant :</label>
            <input type=\"text\" value=\"{{ last_username }}\" name=\"login\" id=\"inputLogin\" class=\"form-control\" placeholder=\"Identifiant\" required autofocus>
        </div>

        <div class=\"form-group\">
            <label for=\"inputPassword\" class=\"sr-only\">Mot de passe :</label>
            <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" placeholder=\"Mot de passe\" required>
        </div>

        <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">
        <button class=\"btn btn-light\" type=\"submit\">
